import React from 'react';

import './style.css';
import Button  from '../atoms/Button';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1> Is your tweet OK</h1>
        <Button content="hello"  href="/"/>
      </header>
    </div>
  );
}

export default App;
